import ReactDOM from 'react-dom';
import Carritoheader from '../components/contactobanner/ContactoBanner';
import Carritonav from '../components/contactoparrafo/ContactoParrafo';
import Carritolistaprecios from '../components/contactoformulario/ContactoFormulario';
import Carritoresumen from '../components/contactoiframe/ContactoIframe';

function Contacto(){
    return(
        <div>
            <ContactoBanner/>
            <ContactoParrafo/>
            <ContactoFormulario/>
            <ContactoIframe/>
            <ContactoRedes/>

        </div>
    );
}
export default Contacto;
